import React from 'react'
import '../PageLayout.scss'
import { FormattedMessage } from 'react-intl';
import  { LANGUAGES }  from '../../../utils/constants';
const Header = () => {
  const sectionTags = [
    { 'Chuyên Khoa' : 'Tìm bác sĩ theo chuyên khoa'},
    { 'Cơ Sở Y Tế' : 'Chọn bệnh viện, phòng khám'},
    { 'Bác Sĩ' : 'Chọn bác sĩ giỏi'},
    { 'Gói Khám' : 'Khám sức khỏe tổng quát'},
  ]
  return (
    <div id='header'>
      <div className="header-item">
        <div className="logo"></div>
      </div>
    <div className="header-item">
      {sectionTags.map((item, index) => {
        return (
          <div key={index} className="item-component">
            <div className="title">{Object.keys(item)}</div>
            <div className="des">{Object.values(item)}</div>
          </div>
        )
      })}
    </div>
    <div className="header-item">
      <div className="item-component">
        Hỗ trợ: <span>(+89) 024-7301-2468</span>
      </div>
      <div className="item-component">
        <div className="vi-btn">VI</div>
        <div className="en-btn">EN</div>
      </div>
    </div>
    </div>
  )
}

export default Header
